import React from "react";
import PersonalSkillItem from './PersonalSkillItem'
import personal_skill_icon from '../Assets/skills.png'
import Heading from './Heading'
import '../Styles/PersonalSkills.css'

const PersonalSkills = (props) => {
    return (
        <div className="personal-skills-container"> 
        <Heading heading = "Personal Skills" icon = {personal_skill_icon}/>
            {props.skills.map(skill => {
                return <PersonalSkillItem skill={skill}/>
            })}
        </div>
    )
}

export default PersonalSkills;
